import React from "react";
import "../App.css";
import "../css/Contact.css";
import Grid from "@material-ui/core/Grid";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEnvelope } from "@fortawesome/free-solid-svg-icons";

function Contact() {
  return (
    <div id="contact" className="background-color-gray padding-top-btm-4e">
      <div>
        <p className="menu-name">Contact</p>
      </div>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={12} md={12}>
          <FontAwesomeIcon icon={faEnvelope} className="icon-size" />
          <p className="text-bold text-1H text-color-bl">Email</p>
          <p>dev_seung2@naver.com</p>
        </Grid>
      </Grid>
    </div>
  );
}

export default Contact;
